import './App.css';
import Start from './components/Start'
import Main from './components/Main'
import Login from './components/Login';

function App() {

  const firstView = () => {
    if (false){
      return <Main/>
    } else {
      return <Login/>
    }
  }


  return (
    <div className="App">
      <header className="App-header">
        <Start />
      </header>
    </div>
  );
}

export default App;
